css:
atom-overlay.autocomplete-plus {
  z-index: 12;
}
autocomplete-suggestion-list.select-list.popover-list {
  width: auto !important;
  display: inline-block;
  min-width: 243px;
  padding: 0;
  overflow: hidden;
  color: #ffffff;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-list-scroller {
  overflow-y: auto;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description {
  padding: 5px 0;
  padding-left: 0.6em;
  padding-right: 0.6em;
  min-height: 2em;
  line-height: 1.3;
  background: #131516;
  border-radius: 0 0 0 0;
  width: min-content;
  min-width: 100%;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description-content {
  font-size: 13px;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  max-height: 33vh;
  display: block;
  overflow-y: auto;
  white-space: pre-wrap;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description-more-link {
  font-size: 13px;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  color: #81a2be;
}
autocomplete-suggestion-list.select-list.popover-list input {
  position: absolute;
  opacity: 0.00;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group {
  margin-top: 0;
  display: table;
  width: 100%;
  margin-right: 10px;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li {
  display: table-row;
  color: #ffffff;
  line-height: 2em;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li > span {
  display: table-cell;
  vertical-align: middle;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li:after {
  clear: both;
  display: block;
  content: ' ';
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .word {
  color: rgba(129, 162, 190, 0.8);
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .character-match {
  color: #81a2be;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .left-label,
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .right-label,
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .snippet-completion {
  color: rgba(129, 162, 190, 0.5);
}
autocomplete-suggestion-list .icon-container {
  width: 2em;
  padding-left: 0;
  padding-right: 0.75em;
}
autocomplete-suggestion-list .icon-container:empty {
  width: 0.6em;
  padding: 0;
}
autocomplete-suggestion-list .icon {
  display: block;
  width: 2em;
  line-height: 2em;
  text-align: center;
  font-style: normal;
  font-weight: bold;
  color: #aaaaaa;
  background: rgba(255, 255, 255, 0.1);
}
autocomplete-suggestion-list .icon:empty {
  display: none;
}
autocomplete-suggestion-list .icon > *::before {
  font-size: 1em;
  width: 1em;
  height: 1em;
}
autocomplete-suggestion-list .icon .icon-letter {
  position: relative;
  top: -0.1em;
  font-size: 0.9em;
  line-height: 0.9em;
}
autocomplete-suggestion-list .left-label {
  text-align: right;
  padding-right: 0.75em;
  vertical-align: middle;
  font-size: 0.9em;
  color: #aaaaaa;
}
autocomplete-suggestion-list .left-label:empty {
  padding-right: 0;
}
autocomplete-suggestion-list .right-label {
  padding-right: 0.75em;
  font-size: 0.9em;
  color: #aaaaaa;
}
autocomplete-suggestion-list .right-label:empty {
  padding-right: 0;
}
autocomplete-suggestion-list .word-container {
  padding-right: 0.75em;
}
autocomplete-suggestion-list .word {
  float: left;
}
autocomplete-suggestion-list .character-match {
  font-weight: bold;
  color: #ffffff;
}
autocomplete-suggestion-list .snippet-completion {
  color: #aaaaaa;
}
autocomplete-suggestion-list .left-label {
  max-width: 20vw;
}
autocomplete-suggestion-list .word {
  max-width: 35vw;
}
autocomplete-suggestion-list .right-label {
  max-width: 25vw;
}
autocomplete-suggestion-list .word,
autocomplete-suggestion-list .left-label,
autocomplete-suggestion-list .right-label {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
autocomplete-suggestion-list .icon.attribute {
  color: #de935f;
  background: rgba(222, 147, 95, 0.2);
}
autocomplete-suggestion-list .icon.builtin {
  color: #b294bb;
  background: rgba(178, 148, 187, 0.2);
}
autocomplete-suggestion-list .icon.class {
  color: #f0c674;
  background: rgba(240, 198, 116, 0.2);
}
autocomplete-suggestion-list .icon.constant {
  color: #de935f;
  background: rgba(222, 147, 95, 0.2);
}
autocomplete-suggestion-list .icon.function {
  color: #81a2be;
  background: rgba(129, 162, 190, 0.2);
}
autocomplete-suggestion-list .icon.import {
  color: #b294bb;
  background: rgba(178, 148, 187, 0.2);
}
autocomplete-suggestion-list .icon.keyword {
  color: #b294bb;
  background: rgba(178, 148, 187, 0.2);
}
autocomplete-suggestion-list .icon.method {
  color: #81a2be;
  background: rgba(129, 162, 190, 0.2);
}
autocomplete-suggestion-list .icon.module {
  color: #b294bb;
  background: rgba(178, 148, 187, 0.2);
}
autocomplete-suggestion-list .icon.mixin {
  color: #f0c674;
  background: rgba(240, 198, 116, 0.2);
}
autocomplete-suggestion-list .icon.package {
  color: #b294bb;
  background: rgba(178, 148, 187, 0.2);
}
autocomplete-suggestion-list .icon.property {
  color: #c5c8c6;
  background: rgba(197, 200, 198, 0.2);
}
autocomplete-suggestion-list .icon.require {
  color: #b294bb;
  background: rgba(178, 148, 187, 0.2);
}
autocomplete-suggestion-list .icon.snippet {
  color: #b5bd68;
  background: rgba(181, 189, 104, 0.2);
}
autocomplete-suggestion-list .icon.tag {
  color: #cc6666;
  background: rgba(204, 102, 102, 0.2);
}
autocomplete-suggestion-list .icon.type {
  color: #f0c674;
  background: rgba(240, 198, 116, 0.2);
}
autocomplete-suggestion-list .icon.value {
  color: #b5bd68;
  background: rgba(181, 189, 104, 0.2);
}
autocomplete-suggestion-list .icon.variable {
  color: #cc6666;
  background: rgba(204, 102, 102, 0.2);
}
autocomplete-suggestion-list .icon.selector {
  color: #de935f;
  background: rgba(222, 147, 95, 0.2);
}
autocomplete-suggestion-list .icon.pseudo-selector {
  color: #de935f;
  background: rgba(222, 147, 95, 0.2);
}
